int main(void) {
  bool game_over = false;
  bool win_lose = false; // true for win, false for lose
  int direction; //3 for up, 2 for down, 1 for left, 0 for right
  int move_count = 0;
  int pattern = 0;
  int pattern2 = 0;
  int remainder;
  int digit_count = 0;
  int delay;
	int counter;
	int shift = 0;
  bool play_again = false;

  disable_A9_interrupts(); // disable interrupts in the A9 processor
	set_A9_IRQ_stack();  	// initialize the stack pointer for IRQ mode
	config_GIC();        	// configure the general interrupt controller
	config_KEYs();       	// configure pushbutton KEYs to generate interrupts
	enable_A9_interrupts();  // enable interrupts in the A9 processor

  int count = 0xbebc200;

  /* timer base address */
	volatile int *timer_ptr = (int *)0xFFFEC600;
	volatile int *control_ptr = (int *)0xFFFEC608;

  *timer_ptr = count;

	*control_ptr = *control_ptr | 0x7;

  srand(time(NULL));  
  
  volatile int *pixel_ctrl_ptr = (int *) 0xFF203020; // DMA

  volatile int *HEX_3_0 = 0xFF200020; // HEX3-0
  volatile int *HEX_4_5 = 0xFF200030; // HEX4-5

  *(pixel_ctrl_ptr + 1) = 0xC8000000;
  pixel_buffer_start = *(pixel_ctrl_ptr + 1);
	
  // swap BackBuffer and Buffer
  wait_for_vsync();
  *(pixel_ctrl_ptr + 1) = 0xC0000000;
  pixel_buffer_start = *(pixel_ctrl_ptr + 1); // draw on BackBuffer
  clear_screen();
	
  wait_for_vsync();

  while (1) {

    playing_now = false;
    timer = 0;
    *HEX_3_0 = 0;
    *HEX_4_5 = 0;

    for (int i = 0; i < 4; i++) {
      for (int j = 0; j < 4; j++) {
        board[i][j] = 0;
        digits[i] = 0;
      }
    }

    //draw instructions 
    draw_instructions();

    //wait for user to press any key then draw board 
    wait_for_press();
	
    clear_screen();
	
    draw_board();
	  

    game_over = false;
    play_again = false;
    highest_num = 1;
    
    // game loop
    while (!game_over) {
      move_count = 0;
      playing_now = true;

      // randomly generate blocks
      generate_blocks();

      // check if the game is over
      game_over = check_game_over();
      if (game_over) {
        win_lose = false;
        continue;
      }

      // get user input
      direction = get_user_input();

      // move blocks
      while (move_count < 3) {
        move_blocks(direction);
        move_count ++;
      }

      move_count = 0;

      // merge blocks
      merge(direction);
        
      // move blocks
      move_count = 0;
      while (move_count < 3) {
        move_blocks(direction);
        move_count ++;
      }

      if (highest_num == 1024) {
        game_over = true;
        win_lose = true;
      } 
    }

    // end of game
    playing_now = false;
    
    // win or lose -> change message on end board
    
    // print play time (timer)
	  clear_screen(); 
    draw_end(win_lose);  

    // display score on HEX3-0
    while (highest_num != 0) {
      
      // get remainder
      remainder = highest_num % 10;
    
      digits[digit_count] = remainder;

      highest_num = highest_num / 10;
      digit_count++;
    }

    for (int j = digit_count - 1; j > -1; j--) {
      message[15-j] = bit_codes[digits[j]];
    }

    volatile int *key_ptr = (int *)0xff200050;
    //volatile int *key_edge =  (int *)0xff20005c;

    int key = *key_ptr & 0x15;
    //int edge = *key_edge;
    int key2 = *key_ptr & 0x15;
    //check if key is pressed 
    
    // display scrolling message for score on HEX displays
    while (!play_again) {
      counter = 16;
      shift = 0;
      
      pattern = 0;
      pattern2 = 0;
      
      while (counter > 0) {
        pattern = 0;
        pattern2 = 0;
        
        for (int j = 2; j < 6; j++) {
          pattern = pattern | (message[j + shift]);
      
          if (j < 5) {
            pattern = pattern << 8;
          }
        }
    
        *HEX_3_0 = pattern;
    
        for (int j = 0; j < 2; j++) {
          pattern2 = pattern2 | (message[j + shift]);
      
          if (j < 1) {
            pattern2 = pattern2 << 8;
          }
        }
    
    
        *HEX_4_5 = pattern2;
        
        delay = 200000000;
      
        while (delay > 0) {
          delay = delay-1;
        }
      
        shift = shift + 1;
        counter = counter - 1;

        key2 = *key_ptr;
      
        if (key2 != 0) {
          key = key2;
          //wait for key to be released  
          while(key2 != 0){
            key2 = *key_ptr;
          }

          play_again = true;
          break;
        }
      }
    }
  }
  
  return 0;
}

bool check_game_over() {
  // check if the board has any empty spots -> game over is false
  // check if there are any adjacent same numbers -> game over is false
  // otherwise game over is true

  for (int i = 0 ; i < 4; i++) {
    for (int j = 0; j < 4; j++) {

      if (board[i][j] == 0) {
          return false;
      } 

      if (j < 3) {
        if (board[i][j] == board[i][j+1]) {
          return false;
        }
      }

      if (i < 3) {
        if (board[i][j] == board[i+1][j]) {
          return false;
        }
      }

    }
  }

  return true;
}

// poll for user input on KEY3-0
int get_user_input() {
  unsigned char byte1 = 0;
  unsigned char byte2 = 0;
  unsigned char byte3 = 0;

  volatile int * PS2_ptr = (int *) 0xFF200100;  // PS/2 port address

  int PS2_data, RVALID;
  bool valid_input = false;

  while (!valid_input) {
   	PS2_data = *(PS2_ptr);    // read the Data register in the PS/2 port
   	RVALID = (PS2_data & 0x8000);    // extract the RVALID field
   	if (RVALID != 0){
   		/* always save the last three bytes received */
   		byte1 = byte2;
   		byte2 = byte3;
   		byte3 = PS2_data & 0xFF;
   	}
   	
    // up
    if ( (byte2 == 0xf0) && (byte3 == 0x75) ) {
      valid_input = true;
   		return 3;
   	} 
    // down
    else if ( (byte2 == 0xf0) && (byte3 == 0x72) ) {
      valid_input = true;
   		return 2;
   	} 
    // left
    else if ( (byte2 == 0xf0) && (byte3 == 0x6b) ) {
      valid_input = true;
   		return 1;
   	} 
    // right
    else if ( (byte2 == 0xf0) && (byte3 == 0x74) ) {
      valid_input = true;
   		return 0;
   	} 
  }
}

// clear the drawing on the screen
void clear_screen() {
  int y, x;

  for (x = 0; x < 320; x++) {
    for (y = 0; y < 240; y++) {
      plot_pixel (x, y, 0);
    }
  }
}


void plot_pixel(int x, int y, short int color) {
  *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = color;
}

void wait_for_vsync() { 
  volatile int * pixel_ctrl_ptr = (int *) 0xFF203020; // DMA
  
  int status;
  
  *pixel_ctrl_ptr = 1; // start the synchronization process
  
  status = *(pixel_ctrl_ptr + 3);
  
  while ((status & 0x01) != 0) {
    status = *(pixel_ctrl_ptr + 3); 
  }
}

int check_zeros() {

    int counter = 0;
    
    // make an array with the x, y positions of the zeros
    for (int i = 0 ; i < 4; i++) {
        for (int j = 0; j < 4; j++) {
            if (board[i][j] == 0) {
                zeros[counter][0] = i;
                zeros[counter][1] = j;
                counter++;
            }
        }
    }
    
   return counter;
}

// randomly generate blocks
void generate_blocks() {
    
    // check where there are zeros
    int count = check_zeros();

    // randomly generate a number to index the array
    int random_one = 0; 
    int random_two = 0; 
    
    // start of the game, generate 2 1 blocks
    if (highest_num == 1) {
        while (random_one == random_two) {
            // generate a random number from 0 to count - 1
            random_one = rand() % count; 
            random_two = rand() % count;
        }
        
        board[zeros[random_one][0]][zeros[random_one][1]] = 1;
        board[zeros[random_two][0]][zeros[random_two][1]] = 1;
    } 
    // generate 1 block of 1 or 2
    else {
        
        // generate a random number from 1 - 2
        random_one = rand() % 2 + 1; 
        
        // generate a random number from 0 to count - 1
        random_two = rand() % count;
        
        board[zeros[random_two][0]][zeros[random_two][1]] = random_one;
    } 
	draw_board_change();
}

void move_blocks(int dir) {
    
    int move_x;
    int move_y;
    int column = 0;
    // move right
    if (dir == 0) {
        move_x = 1;
        move_y = 0;
        
        for (int row = 0; row < 4; row ++) {
            for (int col = 0; col < 3; col ++) {
                if (board[row][col] != 0) {
                    if (board[row + move_y][col + move_x] == 0) {
                    board[row + move_y][col + move_x] = board[row][col];
						move_animate(col,row, col + move_x, row + move_y, board[row][col]);
                        board[row][col] = 0;
						
                    }
                }
            }
        }
  
    } 
    // move left
    else if (dir == 1) {
        move_x = -1;
        move_y = 0;
        
        for (int row = 0; row < 4; row ++) {
            for (int col = 3; col > 0; col --) {
                if (board[row][col] != 0) {
                    if (board[row + move_y][col + move_x] == 0) {
					   move_animate(col,row, col + move_x, row + move_y, board[row][col]);
                       board[row + move_y][col + move_x] = board[row][col];
                        board[row][col] = 0;						
                    }
                }
            }
        }
    } 
    // move down
    else if (dir == 2) {
        move_x = 0;
        move_y = 1;
        
        for (int row = 0; row < 3; row ++) {
            for (int col = 0; col < 4; col ++) {
                if (board[row][col] != 0) {
                    if (board[row + move_y][col + move_x] == 0) {
				      move_animate(col,row, col + move_x, row + move_y, board[row][col]);
                      board[row + move_y][col + move_x] = board[row][col];
                        board[row][col] = 0;						
                    }
                }
            }
        }
    } 
    // move up
    else {
        move_x = 0;
        move_y = -1;
        
        for (int row = 3; row > 0; row --) {
            for (int col = 0; col < 4; col ++) {
                if (board[row][col] != 0) {
                    if (board[row + move_y][col + move_x] == 0) {
					 move_animate(col,row, col + move_x, row + move_y, board[row][col]);
                     board[row + move_y][col + move_x] = board[row][col];
                        board[row][col] = 0;
						
                    }
                }
            }
        }
    }
	//draw_board_change();
}

