//draw the box 
void draw_box(int xidx,int yidx, short int color, int size){
	int i, j;
	for(i = xidx; i<(xidx+ size);i++){ // need to check in the pixel space
		for(j = yidx; j<(yidx+ size);j++){
		 	plot_pixel(i, j, color);
			if(size == 5){
				boardColour[i-70][j-50] = color;
			}
			else{
			    boardColour[i-xidx][j-yidx] = color;
			}
		}
	}
}

void draw_board(){
	
	//draw the box 
	draw_box(70, 50, GREY, 175);
	
	//draw the verical lines 
	draw_line_vertical(110, 50, 0, 5);
	draw_line_vertical(155, 50, 0, 5);
	draw_line_vertical(200, 50, 0, 5);
	
	//draw horizontal lines 
	draw_line_horizontal(70, 90, 0, 5);
	draw_line_horizontal(70, 135, 0, 5);
	draw_line_horizontal(70, 180, 0, 5);
	
	//draw title
	int index = 0;
	for(int j = 0;j<50; j++){	
		for(int i = 102; i<217; i++){
			plot_pixel(i,j, title[index]);
			index++;
			
		}
	}
	
	//draw text 
	int textIndex = 0;
	for(int j = 35;j<50; j++){	
		for(int i = 63; i<257; i++){
			plot_pixel(i,j, text[textIndex]);
			textIndex++;
			
		}
	}
    
}

void draw_line_vertical(int xidx,int yidx, short int color, int size){
	int j;

	for(j = yidx; j<(yidx+175);j+= size){
		draw_box(xidx, j, color, size);
	}
	
}

void draw_line_horizontal(int xidx,int yidx, short int color, int size){
	int i;

	for(i = xidx; i<(xidx+175);i+= size){
		draw_box(i, yidx, color, size);
	}
}

