void move_animate(int xold, int yold, int xnew, int ynew, int num){ //by x y mean colum and row 
	int xStart, xEnd, yStart, yEnd;
	//get starting position for x 
	if(xold == 0){
		xStart = x0;
		xold = x0;
	}
	else if(xold == 1){
		xStart = x1;
		xold = x1;
	}
	else if(xold == 2){
		xStart = x2;
		xold = x2;
	}
	else if(xold == 3){
		xStart = x3;
		xold = x3;
	}
	else{
		xEnd = xStart;
	}
	
	//get ending position for y 
	if(xnew == 0){
		xEnd = x0;
	}
	else if(xnew == 1){
		xEnd  = x1;
	}
	else if(xnew == 2){
		xEnd = x2;
	}
	else if(xnew == 3){
		xEnd = x3;
	}
	else{
		xEnd = xStart;
	}
	
	//get starting position for y 
	if(yold == 0){
		yStart = y0;
	    yold = y0;
	}
	else if(yold == 1){
		yStart = y1;
	    yold = y1;
	}
	else if(yold == 2){
		yStart = y2;
		yold = y2;
	}
	else if(yold == 3){
		yStart = y3;
		yold = y3;
	}
	else{
		yEnd = yStart;
	}
	
	//get ending position for y 
	if(ynew == 0){
		yEnd = y0;
	}
	else if(ynew == 1){
		yEnd  = y1;
	
	}
	else if(ynew == 2){
		yEnd = y2;
	}
	else if(ynew == 3){
		yEnd = y3;
	}
	else{
		yEnd = yStart;
	}
	
	//move block in that direction 
	while(yStart!= yEnd || xEnd!=xStart){
		
		
		if(yStart>yEnd){
			yStart = yStart - 1;
		}
		else if(yStart<yEnd){
			yStart = yStart + 1;
		}
		if(xStart>xEnd){
			xStart = xStart - 1;
		}
		else if(xStart<xEnd){
			xStart = xStart + 1;
		}
		
		if(xStart == xEnd){
			if(yStart<=yEnd){
				for(int j = yold; j<(yStart);j++){
					for(int i = xStart; i<(xStart+40);i++){
						plot_pixel(i, j, boardColour[i-70][j-50]);
					}
				}
			}
			if (yStart >= yEnd){
				for(int j = (yold+40) ; j>(yStart+40);j--){
					for(int i = xStart; i<(xStart+40);i++){
						plot_pixel(i, j, boardColour[i-70][j-50]);
					}
				}
			}
		}
		else if(yStart == yEnd){
			if(xStart<=xEnd){
				for(int j = yold; j<(yold+40);j++){
					for(int i = xold; i<(xStart);i++){
						plot_pixel(i, j, boardColour[i-70][j-50]);
					}
				}
			}
			if(xStart>=xEnd){
				for(int j = yStart; j<(yStart+40);j++){
					for(int i =(xold+40); i>(xStart+40);i--){
						plot_pixel(i, j, boardColour[i-70][j-50]);
					}
				}
			}
			
		}	
		
		draw_blocks(yStart, xStart, num);
	}
	
    //draw the verical lines 
	draw_line_vertical(110, 50, 0, 5);
	draw_line_vertical(155, 50, 0, 5);
	draw_line_vertical(200, 50, 0, 5);
	
	//draw horizontal lines 
	draw_line_horizontal(70, 90, 0, 5);
	draw_line_horizontal(70, 135, 0, 5);
	draw_line_horizontal(70, 180, 0, 5);
	
}

void draw_board_change(){
	int xpos, ypos;
	//find position for the blocks and draw the blocks 
	for(int i =0;i<4; i++){
		for(int j= 0; j<4; j++){
			int num = board[i][j];
			if(i == 0){
				ypos = y0;
			}
			else if(i == 1){
				ypos = y1;
			}
			else if(i == 2){
				ypos = y2;
			}
			else if(i == 3){
				ypos = y3;
			}
			
		    if(j == 0){
				xpos = x0;
			}
			else if(j == 1){
				xpos = x1;
			}
			else if(j == 2){
				xpos = x2;
			}
			else if(j == 3){
				xpos = x3;
			}
			if(num !=0){
				draw_blocks(ypos,xpos, num);
			}
			else{
				int boxIndex = 0;
				for(int y = ypos; y<(ypos+40); y++){
					for( int x = xpos; x<(xpos+40); x++){
						plot_pixel(x, y, GREY);
						boxIndex++;
					}
			   }
			}
		}
	}
}

